Robert Powell, &quot;Singapore Houses&quot; 
English | ISBN: 0804840512 | 2009 | PDF | 240 pages | 22 MB

Demonstrating a remarkable surge of design exploration in the city-state, Singapore Houses charts the architects of Singapore whom are producing work with a level of refinement and sophistication that is comparable with the best in the world. The houses include recent designs by doyens of the profession such as Sonny Chan Sau Yan, Kerry Hill and Ernesto Bedmar in addition to the firmly established &quot;next&quot; generation including Mok Wei Wei, Chan Soo Khian, Siew Man Kok and Richard Hassell.
